export async function GetWork() {
    await fetch('http://localhost:8081/get-works')
        .then(result => result.json())
        .then(res => {
            return  res.data;
        })
}

export function Checkdone(id, isdone){
    fetch(`http://localhost:8081/check-work?id=${id}&isdone=${isdone}`, {
      method: 'PUT'
    }).then((res) => {
      this.GetData();
    })
}
